import React from "react";
import { Navbar, Footer } from "./../index";
import "../../assets/css/blog.css";

const Blog = () => {
  return (
    <section>
      <Navbar />
      <div className="container_blog">
        <h1 className="header_blog fw-bold">Blog</h1>
        <div className="line_br mt-3 mb-4"></div>
      </div>

      <Footer />
    </section>
  );
};

export default Blog;
